import { UserNav } from "../../../component/Navbar/homeNav"
import { getPrinters } from "../../../data/data";
import '../Myprinters.css'
import { useNavigate } from "react-router-dom";
import { useEffect} from "react";
import { useState } from "react";

export default function Modify(){

    const [NamePrinter,SetNamePrinter] = useState("");
    const [Nozzles,SetNozzles] = useState(0);
    const [Soluble,SetSoluble] = useState(false);
    const [place,setPlace] = useState(false);
    const [hold,setHold] = useState("false");

    async function DataChange(){
        console.log(NamePrinter)
        console.log(Nozzles)
        console.log(Soluble)
        console.log(hold)
    }

    async function onClick(event){
        const solu = Soluble
        if(solu == false){
        setHold("false")
        SetSoluble(false);
        }
            else{
                setHold("true")
                SetSoluble(true);
                }
    }


    return(
        <div>
            <UserNav/>
            <table className="myPrinters">
                    <tbody>
                    <tr>
                        <th>Name</th>
                        <th>NozzlesMounted</th>
                        <th>Soluble</th>
                    </tr> 

                    <tr>
                        <th><input type="text" placeholder="Name" onChange={(event)=> SetNamePrinter(event.target.value)}/></th>
                        <th><input type="number" placeholder="nozzles"onChange={(event)=> SetNozzles(event.target.value)}/></th>
                        <th><button className="printerButton" value={hold} onChange={(event) => SetSoluble(event.target.value)} onClick={onClick}>{hold}</button></th>
                    </tr>

                    <button className="printerButton" onClick={DataChange}>Modify</button>
                   </tbody> 
                </table>
        </div>
    )
}
